import React from 'react';
import './Item.css';

const Item = ({ id, image, name, oldPrice, newPrice }) => {
  return (
    <div className='item'>
        <img src={image} alt="" />
        <p>{name}</p>
        <div className="prices">
            <div className="old-price">ብር {oldPrice}</div>
            <div className="new-price">ብር {newPrice}</div>
        </div>
    </div>
  )
}

export default Item;
